sys_variable_value.value:
(function execute(inputs, outputs) {
    if (inputs.status_code == '200' && inputs.response) {
        try {
            var jsonFormat = gs.xmlToJSON(inputs.response);
            var response = jsonFormat["s:Envelope"]["s:Body"]["m:GetEventsResponse"]["m:ResponseMessages"]["m:GetEventsResponseMessage"];
            var responseStatus = response["ResponseClass"];
            if (responseStatus == 'Success') {
                outputs.status = "Success";
                var event_ids = [];
                var notification = response["m:Notification"];
              	var more_events= notification["t:MoreEvents"];
                if (notification["t:ModifiedEvent"]) {
                    var modifiedEvents = notification["t:ModifiedEvent"];
                    for (var i = 0; i < modifiedEvents.length; i++) {
                        if (modifiedEvents[i]["t:ItemId"]) {
							event_ids.push(modifiedEvents[i]["t:ItemId"]["Id"]);
                        }
                      outputs.watermark=modifiedEvents[i]["t:Watermark"];
                    }
                  outputs.event_ids=event_ids;
                } else {
					if(notification["t:StatusEvent"]) {
                      	outputs.watermark=notification["t:StatusEvent"]["t:Watermark"];
                    }
                }
            } else
                outputs = new ExchangeErrorHandler().getEventsBySubscriptionID(inputs, outputs);
        } catch (e) {
            outputs = new ExchangeErrorHandler().getEventsBySubscriptionID(
            inputs, outputs);
        }
    } else
        outputs = new ExchangeErrorHandler().getEventsBySubscriptionID(
            inputs, outputs);
})(inputs, outputs);

